const ArgumentType = require('../../extension-support/argument-type');
const BlockType = require('../../extension-support/block-type');
const Cast = require('../../util/cast');
const log = require('../../util/log');

/**
 * Icon svg to be displayed at the left edge of each extension block, encoded as a data URI.
 * @type {string}
 */
// eslint-disable-next-line max-len
const blockIconURI = 'data:image/svg+xml;base64,';

/**
 * Icon svg to be displayed in the category menu, encoded as a data URI.
 * @type {string}
 */
// eslint-disable-next-line max-len
const menuIconURI = 'data:image/svg+xml;base64,';


/**
 * Class for the new blocks in Scratch 3.0
 * @param {Runtime} runtime - the runtime instantiating this block package.
 * @constructor
 */
class Scratch3Capture {
    constructor(runtime) {
        /**
         * The runtime instantiating this block package.
         * @type {Runtime}
         */
        this.runtime = runtime;

        this._recoder = null;
        this._chunk = null;

        //this._onTargetCreated = this._onTargetCreated.bind(this);
        //this.runtime.on('targetWasCreated', this._onTargetCreated);
    }


    /**
     * @returns {object} metadata for this extension and its blocks.
     */
    getInfo() {
        return {
            id: 'capture',
            name: 'Capture',
            menuIconURI: menuIconURI,
            blockIconURI: blockIconURI,
            blocks: [
                {
                    opcode: "onCaputureLoaded",
                    blockType: BlockType.EVENT,
                    text: "When the captured content is loaded",
                    isEdgeActivated: false
                }, {
                    opcode: 'downloadCapture',
                    blockType: BlockType.COMMAND,
                    text: 'download caputure [TEXT]',
                    arguments: {
                        TEXT: {
                            type: ArgumentType.STRING,
                            defaultValue: "capture"
                        }
                    }
                }, {
                    opcode: 'startMovieCapture',
                    blockType: BlockType.COMMAND,
                    text: 'Start capturing video',
                }, {
                    opcode: 'startAudioCapture',
                    blockType: BlockType.COMMAND,
                    text: 'Start capturing audio',
                }, {
                    opcode: 'startAudioMovieCapture',
                    blockType: BlockType.COMMAND,
                    text: 'Start capturing video and audio',
                }, {
                    opcode: 'pauseCapture',
                    blockType: BlockType.COMMAND,
                    text: 'Pause capturing',
                }, {
                    opcode: 'finishCapture',
                    blockType: BlockType.COMMAND,
                    text: 'Finish capturing',
                }, {
                    opcode: 'saveCapture',
                    blockType: BlockType.COMMAND,
                    text: 'Save capturing',
                }, {
                    opcode: 'getCaptureState',
                    text: 'Get capturing state',
                    blockType: BlockType.REPORTER
                }
            ],
            menus: {

            }
        };
    }

    _cancelCapture() {
        if (!this._recoder) return;

        this._recoder.stop();
    }

    _startCapture(stream, mimeType) {
        this._cancelCapture();

        if (!mimeType || !stream) {
            return;
        }

        this._recoder = new MediaRecorder(stream, { mimeType });
        this._recoder.start();
    }

    startMovieCapture() {
        const stream = this._getCanvasSream();
        const mimeType = this._getMovieMimeType();

        this._startCapture(stream, mimeType);
    }

    startAudioCapture() {
        const stream = this._getAudioStream();
        const mimeType = this._getAudioMimeType();

        this._startCapture(stream, mimeType)
    }

    startAudioMovieCapture() {
        const stream = this._getAudioMovieStream();
        const mimeType = this._getMovieMimeType();

        this._startCapture(stream, mimeType);
    }

    pauseCapture() {
        this._recoder?.pause();
    }

    finishCapture() {
        console.log(this._recoder)
        this._recoder?.stop();
        this._recoder?.addEventListener('dataavailable', ({ data }) => {
            this._chunk = data;
            this.runtime.startHats('capture_onCaputureLoaded');
        })
    }

    saveCapture() {
        this._recoder?.requestData();
        this._recoder?.addEventListener('dataavailable', ({ data }) => {
            this._chunk = data;
            this.runtime.startHats('capture_onCaputureLoaded');
        })
    }

    downloadCapture(args) {
        if (!this._chunk) {
            return;
        }

        const blob = new Blob([this._chunk], { type: this._chunk.type });

        const name = Cast.toString(args.TEXT);
        const a = document.createElement('a');

        a.href = window.URL.createObjectURL(blob);
        a.download = name;
        a.click();
    }

    _getCanvasSream() {
        const canvas = this.runtime.renderer.canvas;
        return canvas.captureStream();
    }
    _getAudioStream() {
        const audioContext = this.runtime.audioEngine.audioContext;
        const audioNode = this.runtime.audioEngine.getInputNode();

        // 出力用のストリームをつくる
        const destination = audioContext.createMediaStreamDestination();

        //nodeをつなげる
        audioNode.connect(destination);

        //無音のタイミングに0Hz（無音）の波形データを流し込む
        const oscillator = audioContext.createOscillator();
        oscillator.connect(destination);

        return destination.stream;
    }

    _getAudioMovieStream() {
        const videoStream = this._getCanvasSream();
        const audioStream = this._getAudioStream();

        return this._conbineStreams([videoStream, audioStream]);
    }

    _conbineStreams(streams) {
        const mediaStream = new MediaStream();

        streams.forEach((stream) => {
            stream.getTracks().forEach((track) => mediaStream.addTrack(track));
        });

        return mediaStream;
    }

    _getAudioMimeType() {
        //.webm
        if (MediaRecorder.isTypeSupported('audio/webm')) {
            return 'audio/webm'
        }
        //.mp3
        if (MediaRecorder.isTypeSupported('audio/mpeg')) {
            return 'audio/mpeg'
        }
        log.error('Unable to get mimetype supported by browser.')
        return null;
    }
    _getMovieMimeType() {
        //.webm
        if (MediaRecorder.isTypeSupported('video/webm')) {
            return 'video/webm'
        }
        //.mp4
        if (MediaRecorder.isTypeSupported('video/mp4')) {
            return 'video/mp4'
        }
        log.error('Unable to get mimetype supported by browser.')
        return null;
    }
    getCaptureState() {
        if (!this._recoder) {
            return 'inactive';
        }
        return this._recoder.state;
    }

    playCapture() {
        const nWin = window.open("");
        if (!nWin) {
            return;
        }

        const blob = new Blob([this._chunk], { type: this._chunk.type });
        const videoElement = document.createElement('video');

        videoElement.src = window.URL.createObjectURL(blob);

        nWin.document.appendChild(videoElement);
    }
}

module.exports = Scratch3Capture;